import React, { useState } from 'react'
import TradeRow from './TradeRow'
import TradeFilters from '../filters/TradeFilters'
import LoadingSpinner from '../common/LoadingSpinner'
import ErrorMessage from '../common/ErrorMessage'
import { useTrades } from '../../hooks/useTrades'
import { useContacts } from '../../hooks/useContacts'
import { toast } from 'react-toastify'
import './TradeTable.css'

const TradeTable = () => {
  const { trades, isLoading, error, expandedRow, setExpandedRow } = useTrades()
  const { contacts } = useContacts()
  const [filters, setFilters] = useState({
    symbol: '',
    dateRange: null,
    showBreaksOnly: false,
    counterparty: '',
    settlementStatus: ''
  })

  if (isLoading) return <LoadingSpinner />
  if (error) return <ErrorMessage message={error.message} />

  const filteredTrades = trades.filter(trade => {
    if (filters.showBreaksOnly && trade.comparison_status === 'Matched') return false
    if (filters.symbol && !trade.securitysymbol.toLowerCase().includes(filters.symbol.toLowerCase())) return false
    if (filters.counterparty && !trade.counterparty.toLowerCase().includes(filters.counterparty.toLowerCase())) return false
    if (filters.settlementStatus && trade.settlement_status !== filters.settlementStatus) return false
    return true
  })

  const handleEmailClick = (trade, e) => {
    e.stopPropagation();
    e.preventDefault();

    console.log('Trying to send email for trade:', trade);
    console.log('Available contacts:', contacts);

    // First check if contact exists at all
    const contact = contacts.find(
      c => c.counterparty_name.toLowerCase().trim() === trade.counterparty.toLowerCase().trim()
    );

    console.log('Found contact:', contact);

    if (!contact) {
      toast.error(`No contact found for ${trade.counterparty}. Please add contact information in the Contacts page.`, {
        position: "top-right",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
      });
      return;
    }

    if (!contact.email) {
      toast.warning(`Contact exists for ${trade.counterparty} but no email address is set. Please update contact information.`, {
        position: "top-right",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
      });
      return;
    }

    const subject = `Trade Reconciliation - ${trade.securitysymbol} - ${trade.tradedate}`;
    const body = `
Hello,

Please verify the following trade details:

Trade Date: ${new Date(trade.tradedate).toLocaleDateString()}
Settlement Date: ${new Date(trade.settlementdate).toLocaleDateString()}
Security: ${trade.securitysymbol}
Price: ${trade.price.toFixed(2)}
Quantity: ${trade.quantity}
DTC Number: ${trade.dtc_number}

Please confirm if these details match your records.

Best regards,
Trade Operations
  `.trim();

    const mailtoUrl = `mailto:${contact.email}?subject=${encodeURIComponent(subject)}&body=${encodeURIComponent(body)}`;
    console.log('Opening mailto URL:', mailtoUrl);

    window.location.href = mailtoUrl;
  };

  return (
    <div className="trade-table-container">
      <TradeFilters filters={filters} onFilterChange={setFilters} />
      <table className="trade-table">
        <thead>
          <tr>
            <th></th>
            <th>Trade Date</th>
            <th>Age</th>
            <th>Security Symbol</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Settlement Date</th>
            <th>Counterparty</th>
            <th>DTC Number</th>
            <th>Comparison Status</th>
            <th>Settlement Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredTrades.map(trade => (
            <TradeRow 
              key={trade.id}
              trade={trade} 
              onEmailClick={handleEmailClick}
              isExpanded={expandedRow === trade.id}
              onExpandClick={() => setExpandedRow(expandedRow === trade.id ? null : trade.id)}
            />
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default TradeTable
